Личную, данную страничку давно бы заморозил, но в связи с многочисленными первичными вопросами по работе (Детские киносериалы / Федерация юмора России) и переезду на ПМЖ в Калининград, готов общаться и использовать социальную сеть "Вконтакте" по назначению.

KIDSEE / ДЕТСКИЕ КИНОСЕРИАЛЫ

Мы создаем детские сериалы kidsee! А для кинорежиссеров, блогеров, создателей интересного видео и просто талантливых персоналий, мы создаем четкие правила и лекала, социальный лифт в мир больших и web сериалов! 

ЕВРОГИД / ПЕРЕЕЗД В КАЛИНИНГРАД

Мы с семьей, с двумя детьми, переехали из большой России в Калининград. Ныне полноценно проживаем тут и пользуемся всеми благами, которые дарит Балтика. В своем видеоблоге www.youtube.com/manager2018 рассказываю о всех плюсах и минусах европейской России, отвечаю на ваши вопросы в личке, а также совместно обсуждаем текущую жизнь на www.vk.com/kaliningradpereezd

Консультирую, отвечаю на все вопросы по переезду и адаптации абсолютно бесплатно! На платной основе могу лишь возить вас по квартирным, обзорным и атмосферным турам для ознакомления (так-как потребуется много времени), либо выступить в качестве специалиста при подбору и покупке/продаже/аренде недвижимости (большой опыт и профильное образование позволяет), а также выступить вашим представителем в Калининграде или странах ЕС (любые задачи обсуждаются: от открытия юрлица и проведения переговоров в ваших интересах до "передайте документы и посылку")! 

Вот истории, с которыми мне пришлось столкнуться и успешно перелистнуть:
- выбор Калининграда: все за и против;
- первый приезд в Калининград на две недели, чтобы "познакомиться, присмотреться";
- сбор всех документов (чтобы больше не ездить за ними на прежнее место жительство);
- подбор транспортной компании, перевозка вещей из России в Калининград (очень важные тонкости!);
- подбор и аренда квартиры посуточно и долгосрочно (много тонкостей);
- получение временной регистрации и прописки;
- поиск работы по найму;
- устройство детей в коммерческий и государственный детский сад, в хорошую школу сразу после приезда;
- закрепление в поликлиниках и страховых компаниях;
- подбор, покупка квартиры, ипотека, юридическое оформление (там продать - тут купить);
- покупка авто в Калининграде и странах ЕС, его проверка;
- получение ВНЖ в ЕС;
- поездки на авто в страны ЕС (от «купить продуктов на 2 часа», «съездить в уикенд» до двухнедельных туров);
- открытие бизнеса в ЕС и многое другое...
Подробности на www.vk.com/kaliningradpereezd
Как-то так. Обращайтесь, пишите, не стесняйтесь...

P.S. - ЧАСТО ЗАДАВАЕМЫЕ ВОПРОСЫ
- Вы бесплатно помогаете в переезде, отвечаете на вопросы? 
- Да, я создал видеоканал о переезде в Калининград и отвечаю на все вопросы, консультирую абсолютно бесплатно, на голом энтузиазме. Для меня это хобби, выстраивание нового круга общения, с помощью, которого адаптация на новом месте проходит проще) Нет никаких "подводных камней". Собственный опыт, рассказываю, где "набил шишки", все абсолютно честно, "без купюр". Мне интересна тема миграции, узким специалистом, в которой я стараюсь быть. 

- И всё же, а что у вас платно? 
- Я закончил московский ВУЗ - Финансовый университет, юрфак, тема диплома "Сделки с недвижимостью и ипотека". Работал по этому профилю. Поэтому, если понадобятся услуги юриста в данной сфере - я с удовольствием соглашусь Вам помочь, подобрать квартиру, дом для покупки и проживания + какие то косвенные услуги. Это уже платно, но это нужно не всем!
